import React from "react";
import styles from "./Workers.module.css";
import { Manager,Workers as workers,AddWorkersCommand,FireWorkersCommand } from './WorkersCommand.js';


const Workers = (props) => {
    const manager=new Manager();
    const worker=new workers();
    manager.SetCommand(AddWorkersCommand(worker));
    manager.ExecuteCommands();
  return <div className={styles.workersContainer}>
      <p>Workers front-end part</p>
  </div>
};
export default Workers;
